import TopNavBar from '../TopNavBar';
import React, { Component } from "react";
//import AddEmployee from "./Components/AddEmployee";
import { Route, BrowserRouter as Router } from "react-router-dom";
//import Table from "./Components/Table";
//import App from './App';
import background from '../charitybackground.jfif';
import ReactDOM from 'react-dom';
import Recipients from "../Components/Recipients";
import HomePageCharities from '../Components/HomePageCharities';
import { Container } from 'react-bootstrap';
import Footer from '../Footer';



class HomeAdmin extends React.Component {




    // get user details from session storage
    componentDidMount() {
        this.userData = JSON.parse(sessionStorage.getItem('user'));
        console.log(this.userData)

        if (sessionStorage.getItem('user')&&this.userData.usertype===0) {
            this.setState({
                userid: this.userData.userid,
                username: this.userData.username,
                usertype: this.userData.usertype,
                loggedin: true
            })
        }else {
            this.setState({
                userid: '',
                username: '',
                usertype: '',
                loggedin: false
            })
        }

        if(this.state.usertype=='2'){
            this.setState({loggedin: true})
        }
        else{
            console.log(this.state.usertype)
        }
    }

        constructor(props) {
            super(props);
            this.state = {
                currentPage: "HomePageAdmin"
            };
          }

          

    render() {
        const { usertype } = this.state;
        console.log(usertype)
        
        if (!this.state.usertype===null) {
            return <p>{this.state.usertype}</p>;
        }
        return (
            <>
                <TopNavBar data={this.state}/>
                <h1>Welcome you have been logged in {this.state.username} </h1>
                <Footer />
            </>
        )
        
    }
}

ReactDOM.render(
    <HomeAdmin />,
    document.getElementById('root')
);


export default HomeAdmin;
